import{_ as r,c as e,a4 as a,o as d}from"./chunks/framework.DKq7WeZY.js";const b=JSON.parse('{"title":"1. 初识RTKLIB","description":"","frontmatter":{},"headers":[],"relativePath":"algorithm/RTKLIB-Source-Notes/01-overview-1.6.md","filePath":"algorithm/RTKLIB-Source-Notes/01-overview-1.6.md"}'),o={name:"algorithm/RTKLIB-Source-Notes/01-overview-1.6.md"};function h(n,t,i,l,s,P){return d(),e("div",null,t[0]||(t[0]=[a('<h1 id="_1-初识rtklib" tabindex="-1">1. 初识RTKLIB <a class="header-anchor" href="#_1-初识rtklib" aria-label="Permalink to &quot;1. 初识RTKLIB&quot;">​</a></h1><h2 id="_1-5-延伸项目" tabindex="-1">1.5 延伸项目 <a class="header-anchor" href="#_1-5-延伸项目" aria-label="Permalink to &quot;1.5 延伸项目&quot;">​</a></h2><p>各种各样的都有，有对定位解算算法做增强的、有做组合导航的、有做服务端程序的、有做软件接收机的、做应用的。下面介绍几个我了解的：</p><table tabindex="0"><thead><tr><th>项目名称</th><th>链接</th><th>简介</th></tr></thead><tbody><tr><td>RTKLIB-demo5</td><td><a href="https://github.com/rtklibexplorer/RTKLIB" target="_blank" rel="noreferrer">GITHUB</a></td><td>针对低成本接收机做了算法增强。</td></tr><tr><td>rtklib-py</td><td><a href="https://github.com/rtklibexplorer/rtklib-py" target="_blank" rel="noreferrer">GITHUB</a></td><td>用 Python 编写的免费开源 RTKLIB 子集。最初基于 CSSRlib，但已重新编写以与 RTKLIB 的 demo5 版本高度一致。</td></tr><tr><td>GAMP</td><td><a href="https://geodesy.noaa.gov/gps-toolbox/GAMP.htm" target="_blank" rel="noreferrer">https://geodesy.noaa.gov/gps-toolbox/GAMP.htm</a></td><td>山科大周锋写的双频浮点解 PPP，在 RTKLIB 基础上做精简和算法的增强，比原版 RTKLIB 简单，是入门学习 PPP 不错的选择。</td></tr><tr><td>Ginan</td><td><a href="https://github.com/GeoscienceAustralia/ginan" target="_blank" rel="noreferrer">GITHUB</a></td><td>来自澳大利亚，包括精密定位程序 PEA、定轨程序 POD，文档很详细，代码比较难懂。</td></tr><tr><td>GraphGNSSLib</td><td><a href="https://github.com/weisongwen/GraphGNSSLib" target="_blank" rel="noreferrer">GITHUB</a></td><td>港理工项目，支持图优化 SPP、RTK，作者在知乎很活跃，发过一些科普文章。</td></tr><tr><td>GLIO</td><td><a href="https://github.com/XikunLiu-huskit/GLIO" target="_blank" rel="noreferrer">GITHUB</a></td><td>在 GraphGNSSLib 基础上做的 GNSS-IMU-Lidar 图优化紧组合。</td></tr><tr><td>PPPLIB</td><td><a href="https://geodesy.noaa.gov/gps-toolbox/PPPLib.htm" target="_blank" rel="noreferrer">https://geodesy.noaa.gov/gps-toolbox/PPPLib.htm</a></td><td>作者老师在矿大读研时所写，支持三频 SPP、PPK、PPP 和 IMU 组合。</td></tr><tr><td>GINAV</td><td><a href="https://github.com/kaichen686/GINav" target="_blank" rel="noreferrer">GITHUB</a></td><td>MATLAB 紧组合项目，文件名和 RTKLIB 函数名一样。虽说是组合导航，但也可只用其中的 GNSS 部分，相比 goGPS 简单不少。</td></tr><tr><td>GICI-LIB</td><td><a href="https://github.com/chichengcn/gici-open" target="_blank" rel="noreferrer">GITHUB</a></td><td>上海交大池澄博士开源的 GNSS-IMU-Camera 图优化多源融合程序，以 GNSS 为主，实现了 RTK、PPP 的模糊度固定。</td></tr><tr><td>PPP-AR</td><td><a href="https://github.com/PrideLab/PRIDE-PPPAR" target="_blank" rel="noreferrer">GITHUB</a></td><td>武大 GNSS 中心开源的后处理 PPP，使用配套的产品可以实现 PPP 模糊度固定，支持五频数据处理，使用了 rnx2rtkp 可执行程序计算测站初值坐标。</td></tr><tr><td>IGNAV</td><td><a href="https://github.com/Erensu/ignav" target="_blank" rel="noreferrer">GITHUB</a></td><td>武大 GNSS 中心项目。</td></tr><tr><td>pppwizard</td><td><a href="http://www.ppp-wizard.net/" target="_blank" rel="noreferrer">http://www.ppp-wizard.net/</a></td><td>暂无详细介绍。</td></tr><tr><td>GNSS-SDR</td><td><a href="https://github.com/gnss-sdr/gnss-sdr" target="_blank" rel="noreferrer">GITHUB</a></td><td>GNSS 软件接收机，实现基带算法直接对接收机输出的数字中频信号处理，PVT 部分用了 RTKLIB。</td></tr><tr><td>PocketSDR</td><td><a href="https://github.com/tomojitakasu/PocketSDR" target="_blank" rel="noreferrer">GITHUB</a></td><td>RTKLIB 作者新开源的软件接收机，包含一个射频前端和一套后处理 GNSS 接收机程序（只支持后处理），实现了一整套完整的 GNSS 接收机功能，采用 C、Python 编写，支持几乎所有的 GNSS 信号（比商业接收机支持的还要多），引入 RTKLIB 做库，用到了 RTKLIB 的一些结构体。</td></tr><tr><td>APOLLO</td><td><a href="https://github.com/ApolloAuto/apollo" target="_blank" rel="noreferrer">GITHUB</a></td><td>百度的开源无人驾驶系统，用到了 RTKLIB 的 NMEA 结构体。</td></tr></tbody></table>',4)]))}const g=r(o,[["render",h]]);export{b as __pageData,g as default};
